import React, { Component, useEffect } from 'react';

export default function Loading(){

    function timeout(){
        setInterval(console.log("gone"), 10000)
    }

    useEffect(()=>{
        timeout()
    })

    return(
        <div className='Loading'>
            <img src="loading.gif" alt='Loading'/>
        </div>
    )
}
